const PostPhoto = ({ image, username }) => {
  username = `Esta publicación fue creada por ${username}`;
  return (
    <li key={image.id}>
      <img src={`http://localhost:4000/${image.name}`} alt={username} />
    </li>
  );
};

export default PostPhoto;
